uint8_t receiveMessage(char* data) {

	// usleep(10000);
	
	if(dfuMode == 1) {

		int receiveRet = read(f,data,2);

		// while(receiveRet<0) {
		// 	receiveRet = read(f,data,2);
		// }

		uint32_t initialInc = 0;
		while(receiveRet<0) {
			receiveRet = read(f,data,2);
			usleep(10000);
			initialInc++;

			if(initialInc>25) {
				printf("There's an error\n");
				// exit(0);
				return 0;
			}
		}

		receiveRet = read(f,&data[2],((data[0]<<8)|data[1])+2);
		while(receiveRet<0) {
			receiveRet = read(f,&data[2],((data[0]<<8)|data[1])+2);
		}

		// printf("receiveRet2: %d %d\n",receiveRet,((data[0]<<8)|data[1])+2);
		printf("R: ");
		for(int i = 0 ; i < ((data[0]<<8)|data[1])+2+2 ; i++) {
			printf("%02x ",data[i]);
		}
		printf("\n");

	} else {

		int receiveRet = read(f,data,3);

		uint32_t initialInc = 0;
		while(receiveRet<0) {
			receiveRet = read(f,data,3);
			usleep(10000);
			initialInc++;

			if(initialInc>50) {
				printf("There's an error\n");
				exit(0);
				return 0;
			}
		}

		receiveRet = read(f,&data[3],data[2]);
		while(receiveRet<0) {
			receiveRet = read(f,&data[3],data[2]);
		}

		printf("R: ");
		for(int i = 0 ; i < data[2]+3 ; i++) {
			printf("%02x ",data[i]);
		}
		printf("\n");
	}

	return 1;
}

void sendLargePayload(char* data, uint32_t len) {

	uint8_t cmd[65536];

	for(int i = 0 ; i < len ; i+= 0xfc) {

		if( (i+0xfc) >= len ) {
			cmd[0] = 0x00;
			cmd[1] = (len-i);

		} else {
			cmd[0] = 0x04;
			cmd[1] = 0xfc;

		}

		memcpy(&cmd[2],&data[i],cmd[1]);
		uint16_t crc = crc16_ccitt(cmd,cmd[1]+2);

		cmd[cmd[1]+2] = crc>>8;
		cmd[cmd[1]+2+1] = crc&0xff;		

		// printf("Cmd: ");
		// for(int j = 0 ; j < (cmd[1]+2+2) ; j++) {
		// 	printf("%02x ",cmd[j]);
		// }
		// printf("\n");

		sendMessage(cmd,cmd[1]+4);
		printf("%02x(%d): ",data[0],len);
		receiveMessage(retData);


	}
}




