void generateBlockCommand(uint8_t* commandMem, struct FirmwareChunk* firmwareChunk) {

	commandMem[0] = 0xc0;
	memcpy(&commandMem[1], &firmwareChunk->address,3);
	commandMem[4] = 0x00;
	commandMem[5] = 0x02;
	memcpy(&commandMem[6],&firmwareChunk->blockData,0x200);

}

